set -ex; echo "tools/ unittests (Python 2)"; ~/start.sh https://github.com/web-platform-tests/wpt.git refs/pull/18403/merge; cd ~/web-platform-tests; export TOXENV=py27; export HYPOTHESIS_PROFILE=ci; export PY_COLORS=0; ./tools/ci/run_tc.py \
  tools_unittest \
  tools/ci/ci_tools_unittest.sh;

